import { StyleSheet, Text, View } from "react-native";
import React from "react";

const styles = StyleSheet.create({
  background: {
    flex: 1,
    background: "cream",
    alignItems: "center",
    justifyContent: "center",
  },
  container: {
    flex: 1,
    backgroundColor: "blue",
    alignItems: "center",
    justifyContent: "center",
  },
});
